import React, { useState } from "react";

const TrainingRecord = () => {
  const [sets, setSets] = useState([
    { weight: 85, reps: 5, complete: false, timer: "2:00" },
    { weight: 85, reps: 5, complete: false, timer: "2:00" },
    { weight: 85, reps: 5, complete: false, timer: "2:00" },
  ]);

  const handleAddSet = () => {
    setSets([...sets, { weight: 85, reps: 5, complete: false, timer: "2:00" }]);
  };

  const handleRemoveSet = (index) => {
    const updatedSets = sets.filter((_, i) => i !== index);
    setSets(updatedSets);
  };

  const handleUpdateSet = (index, field, value) => {
    const updatedSets = sets.map((set, i) =>
      i === index ? { ...set, [field]: value } : set
    );
    setSets(updatedSets);
  };

  return (
    <div style={{ height: "100vh", overflowY: "auto", padding: "20px", fontFamily: "Arial, sans-serif" }}>
      <h2 style={{ textAlign: "center" }}>トレーニング記録 : 12月15日（木）</h2>
      <div style={{ backgroundColor: "#f0f8ff", padding: "10px", borderRadius: "5px", textAlign: "center" }}>
        <p>
          種目：<input type="text" defaultValue="ベンチプレス" readOnly />
        </p>
        <p>対象部位：胸</p>
        <p>MAX重量：95kg</p>
        <p>消費カロリー：xxxkcal</p>
      </div>

      <div style={{ display: "grid", gridTemplateColumns: "repeat(6, 1fr)", gap: "10px", marginTop: "20px" }}>
        <div style={{ textAlign: "center", fontWeight: "bold" }}>セット</div>
        <div style={{ textAlign: "center", fontWeight: "bold" }}>kg</div>
        <div style={{ textAlign: "center", fontWeight: "bold" }}>回</div>
        <div style={{ textAlign: "center", fontWeight: "bold" }}>完了</div>
        <div style={{ textAlign: "center", fontWeight: "bold" }}>タイマー</div>
        <div style={{ textAlign: "center", fontWeight: "bold" }}>操作</div>

        {sets.map((set, index) => (
          <React.Fragment key={index}>
            <div style={{ textAlign: "center" }}>{index + 1}</div>
            <div style={{ textAlign: "center" }}>
              <input
                type="number"
                value={set.weight}
                onChange={(e) => handleUpdateSet(index, "weight", e.target.value)}
                style={{ width: "60px" }}
              />
            </div>
            <div style={{ textAlign: "center" }}>
              <input
                type="number"
                value={set.reps}
                onChange={(e) => handleUpdateSet(index, "reps", e.target.value)}
                style={{ width: "60px" }}
              />
            </div>
            <div style={{ textAlign: "center" }}>
              <button
                onClick={() => handleUpdateSet(index, "complete", !set.complete)}
                style={{
                  backgroundColor: set.complete ? "lightgreen" : "lightcoral",
                  border: "none",
                  borderRadius: "5px",
                  padding: "5px 10px",
                }}
              >
                {set.complete ? "完" : "レ"}
              </button>
            </div>
            <div style={{ textAlign: "center" }}>
              <input
                type="text"
                value={set.timer}
                onChange={(e) => handleUpdateSet(index, "timer", e.target.value)}
                style={{ width: "60px" }}
              />
            </div>
            <div style={{ textAlign: "center" }}>
              <button
                onClick={() => handleRemoveSet(index)}
                style={{
                  backgroundColor: "red",
                  color: "white",
                  border: "none",
                  borderRadius: "5px",
                  padding: "5px 10px",
                }}
              >
                セット削除
              </button>
            </div>
          </React.Fragment>
        ))}
      </div>

      <div style={{ textAlign: "center", marginTop: "20px" }}>
        <button
          onClick={handleAddSet}
          style={{
            backgroundColor: "lightblue",
            border: "none",
            borderRadius: "5px",
            padding: "10px 20px",
            cursor: "pointer",
          }}
        >
          + セット追加
        </button>
      </div>
    </div>
  );
};

export default TrainingRecord;
